import React from 'react';

import Grid from '@material-ui/core/Grid';
import Box from './utils/Box'

import './DateContainer.css'
const section = {
    minHeight: "100px",
    paddingTop: 5,
  };
export default class DateContainer extends React.Component {
    render() {
        return (
            <Grid item xs={12}>
                <div style={section}>
                    <Box>
                        <h1>Testing...</h1>
                    </Box>
                </div>
            </Grid>

        );
    }
}
